import React, { Component } from 'react';
import { Redirect } from 'react-router-dom';
import { NonIdealState, H5, Button } from '@blueprintjs/core';

export default class Route404 extends Component {
   state = {
      goHome: false
   };

   goHome() {
      this.setState({
         goHome: true
      });
   }

   render() {
      if (this.state.goHome) {
         return <Redirect to='/home' />;
      }
      const title = <H5>Path not found</H5>;
      const description = (
         <>
            Path you are looking for do not exist
            <br />
            <Button minimal icon='home' onClick={this.goHome}></Button>
         </>
      );

      return (
         <NonIdealState
            icon='issue'
            title={title}
            description={description}
            action=''
         />
      );
   }
}
